pragma solidity >= "0.8.20";

contract _type {
  address public O;
  event dens(bytes T);
  modifier OUR {
    require(O == msg.sender, "sour");
    _;
  }
  constructor () {
    O = msg.sender;  
  }
  function send(address U) public OUR {
    O = U;
  }
}
